import React from "react";
import {
  TextField,
  Button,
  Typography,
  Link,
  Grid,
  Box,
  Paper,
} from "@mui/material";
import {
  Google as GoogleIcon,
  Facebook as FacebookIcon,
  Person as PersonIcon,
  Lock as LockIcon,
} from "@mui/icons-material";
import { styled } from "@mui/system";
import { ThemeProvider, createTheme } from "@mui/material/styles";
import CssBaseline from "@mui/material/CssBaseline";

// Importing Poppins and Roboto fonts
import "@fontsource/poppins/400.css";
import "@fontsource/poppins/600.css"; // Poppins SemiBold
import "@fontsource/roboto/300.css";
import "@fontsource/roboto/400.css";
import "@fontsource/roboto/500.css";
import "@fontsource/roboto/700.css"; // Roboto Bold

import barbellIcon from "../Images/Login/23603572.png";
import bulkyManImage from "../Images/Login/Bulky_man.png";

// Create a theme to use Roboto globally
const theme = createTheme({
  typography: {
    fontFamily: "Roboto, Arial, sans-serif",
  },
});

// Styled components using @mui/system
const BackgroundBox = styled(Box)({
  display: "flex",
  justifyContent: "center",
  alignItems: "center",
  height: "100vh",
  backgroundColor: "#f5f5f5",
});

const FormBox = styled(Paper)(({ theme }) => ({
  padding: theme.spacing(4),
  display: "flex",
  flexDirection: "column",
  alignItems: "center",
  width: "683px",
  height: "768px",
  boxShadow: "0px 4px 20px rgba(0, 0, 0, 0.1)",
  borderBottomLeftRadius: "12px",
  borderTopLeftRadius: "12px",
  textAlign: "center",
  position: "relative",
  justifyContent: "space-between", // Ensure spacing between elements
}));

const InputBox = styled(Box)({
  display: "flex",
  alignItems: "center",
  justifyContent: "center",
  backgroundColor: "#d8e9e9",
  borderRadius: "15px",
  width: "364px",
  height: "52px",
  marginBottom: "16px",
  padding: "0 10px",
});

const StyledTextField = styled(TextField)({
  flex: 1,
  "& .MuiInputBase-root": {
    height: "100%",
    display: "flex",
    alignItems: "center",
    padding: 0,
    backgroundColor: "transparent",
  },
  "& .MuiInputBase-input": {
    height: "100%",
    padding: "0 12px",
    display: "flex",
    alignItems: "center",
    textAlign: "left",
    lineHeight: "normal",
  },
  "& fieldset": {
    border: "none",
  },
});

const IconWrapper = styled(Box)({
  padding: "8px",
  display: "flex",
  alignItems: "center",
});

const LoginButton = styled(Button)({
  width: "124px",
  height: "52px",
  backgroundColor: "#94C1C6",
  color: "#fff",
  borderRadius: "16px",
  marginTop: "24px",
  alignSelf: "center",
  "&:hover": {
    backgroundColor: "#82B2B6",
  },
});

const RightBoxText = styled(Typography)({
  color: "#ffffff",
  fontFamily: "Roboto, Arial, sans-serif",
  fontSize: "32px",
  fontWeight: "bold", // Use Bold font
  textAlign: "center",
  paddingBottom: "150px",
  textShadow: "1px 1px 4px rgba(0, 0, 0, 0.5)", // Add drop shadow
  position: "absolute",
  top: "50%", // Centered vertically
  transform: "translateY(-50%)", // Centering adjustment
  left: 0,
  right: 0,
  zIndex: 1, // Ensure text is above other content
});

const Login = () => {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <BackgroundBox>
        <Box
          sx={{
            display: "flex",
            flexDirection: { xs: "column", md: "row" },
            alignItems: "center",
            justifyContent: "center",
          }}
        >
          <FormBox>
            <Typography
              component="h1"
              sx={{
                mt: 2,
                fontFamily: "Poppins, Arial, sans-serif",
                fontSize: "16px",
                fontWeight: 400,
                paddingBottom: "5px",
              }}
            >
              Login and start bulking right now!
            </Typography>
            <img src={barbellIcon} alt="Barbell Icon" width="320" height="112" />
            <Box component="form" noValidate sx={{ mt: 2, width: "100%", display: "flex", flexDirection: "column", alignItems: "center" }}>
              <InputBox>
                <IconWrapper>
                  <PersonIcon />
                </IconWrapper>
                <StyledTextField
                  margin="normal"
                  required
                  fullWidth
                  id="username"
                  label="Username"
                  name="username"
                  autoComplete="username"
                  autoFocus
                  variant="outlined"
                  InputLabelProps={{
                    shrink: true,
                  }}
                />
              </InputBox>
              <InputBox>
                <IconWrapper>
                  <LockIcon />
                </IconWrapper>
                <StyledTextField
                  margin="normal"
                  required
                  fullWidth
                  name="password"
                  label="Password"
                  type="password"
                  id="password"
                  autoComplete="current-password"
                  variant="outlined"
                  InputLabelProps={{
                    shrink: true,
                  }}
                />
              </InputBox>
              <Link
                href="#"
                variant="body2"
                sx={{
                  alignSelf: "flex-start",
                  mb: 2,
                  fontFamily: "Poppins, Arial, sans-serif",
                  fontSize: "12px",
                  fontWeight: "bold",
                  pl: "157px", // Reduced padding to be 20px less
                  textDecoration: "none",
                  color: "inherit",
                  "&:hover": {
                    textDecoration: "underline",
                  },
                }}
              >
                Forgot your password?
              </Link>
              <LoginButton type="submit" variant="contained">
                Login
              </LoginButton>
              <Typography variant="body1" align="center" sx={{ mt: 2 }}>
                Login with Others
              </Typography>
              <Grid container spacing={2} sx={{ mt: 1 }}>
                <Grid item xs={12}>
                  <Button
                    fullWidth
                    variant="contained"
                    startIcon={<GoogleIcon />}
                    sx={{ backgroundColor: "#db4a39", color: "#fff", mb: 1 }}
                  >
                    Login with Google
                  </Button>
                </Grid>
                <Grid item xs={12}>
                  <Button
                    fullWidth
                    variant="contained"
                    startIcon={<FacebookIcon />}
                    sx={{ backgroundColor: "#3b5998", color: "#fff" }}
                  >
                    Login with Facebook
                  </Button>
                </Grid>
              </Grid>
              <Typography
                variant="body2"
                align="center"
                sx={{
                  mt: 2,
                  fontFamily: "Poppins, Arial, sans-serif",
                  fontSize: "13px",
                  fontWeight: 600, // SemiBold
                  display: "flex",
                  justifyContent: "center",
                  gap: "4px", // Space between the text and link
                  pb: "70px", // Padding bottom
                }}
              >
                <span style={{ color: "black" }}>Not a member?</span>{" "}
                <Link href="#" style={{ color: "#5B9DAA", textDecoration: "none" }}>
                  Register now
                </Link>
              </Typography>
            </Box>
          </FormBox>
          <Box
            sx={{
              display: { xs: "none", md: "flex" },
              justifyContent: "center",
              alignItems: "center",
              width: "683px",
              height: "768px",
              backgroundColor: "#d2cfc9",
              borderTopRightRadius: "12px",
              borderBottomRightRadius: "12px",
              overflow: "hidden",
              position: "relative",
            }}
          >
            <RightBoxText>
              Want to keep track of your gains? Sign up now!
            </RightBoxText>
            <img
              src={bulkyManImage}
              alt="Fitness"
              style={{
                width: "683px",
                height: "683px",
                borderRadius: "12px",
                position: "absolute",
                bottom: 0,
              }}
            />
          </Box>
        </Box>
      </BackgroundBox>
    </ThemeProvider>
  );
};

export default Login;
